(14, 1, '2022-09-18 14:03:27', '2022-09-18 11:03:27', '<!-- wp:paragraph -->\n<p><div id=\"root\"><div id=\"main-wrapper\" class=\"bbc-pugjnv eoodvxp1\"><div class=\"bbc-1ff36h2 eoodvxp0\"><div class=\"bbc-j6e0v4 e123m4vu4\"><div dir=\"ltr\" class=\"e2un9en2 bbc-klixw8 ebmt73l0\"><div dir=\"ltr\" class=\"e2un9en1 bbc-1hwgxf ebmt73l0\"><main role=\"main\" class=\"bbc-1fh9ug8 e123m4vu2\"><div dir=\"ltr\" class=\"bbc-1151pbn ebmt73l0\"><h1 id=\"content\" tabindex=\"-1\" class=\"bbc-csfh25 e1p3vdyi0\"><h1 id=\"content\" tabindex=\"-1\" class=\"bbc-csfh25 e1p3vdyi0\">Sheekh Umal iyo Khadiijo Maxamed Diiriye oo gorodda iskula jira</h1></div></main></div></div></div></div></div></div></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:image {\"id\":12,\"sizeSlug\":\"full\",\"linkDestination\":\"none\"} -->\n<figure class=\"wp-block-image size-full\"><img src=\"http://localhost/tabaarak/wp-content/uploads/2022/09/w2.webp\" alt=\"\" class=\"wp-image-12\"/></figure>\n<!-- /wp:image -->\n\n<!-- wp:paragraph -->\n<p><strong>Waxaa si weyn loo hadal hayaa hadal kasoo baxay Sheekha Soomaaliyeed ee caanka ah Sheekh Maxamed Cabdi Umal oo dhaliilay waxa uu ku tilmaamay sarwaal ay horey u xiratay wasiirka gargaarka iyo maareynta masiibooyinka Soomaaliya, Khadiijo Maxamed Diiriye, inkasta uusan si cid u sheegin magaca qofka ay farrintiisa ku socotay.</strong></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Balse waxaa hadalkan jawaab ka bixisay wasiir Khadiijo oo sheegtay in Sheekha aanay waxbo ka gelin sarwaalka maadama dumar badan oo Muslimiin ah ay xirtaan.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>\"Wasiirad dowladda Soomaaliya ka tirsan oo meel fagaare ah laa taagan tahay sarwalkii ragga ay gogosha ku seexanayeen ayay la taagan tahay oo ay isku sawirreysaa, markaas ayay baraha bulshada soo dhigeysaa xitaa xishood darrada iyo sariig la\'aanta heerkaas ayay gaartay\"</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:cover {\"url\":\"http://localhost/tabaarak/wp-content/uploads/2022/09/w22.webp\",\"id\":13,\"dimRatio\":50,\"minHeight\":592,\"minHeightUnit\":\"px\",\"isDark\":false,\"style\":{\"color\":{}}} -->\n<div class=\"wp-block-cover is-light\" style=\"min-height:592px\"><span aria-hidden=\"true\" class=\"wp-block-cover__background has-background-dim\"></span><img class=\"wp-block-cover__image-background wp-image-13\" alt=\"\" src=\"http://localhost/tabaarak/wp-content/uploads/2022/09/w22.webp\" data-object-fit=\"cover\"/><div class=\"wp-block-cover__inner-container\"><!-- wp:paragraph {\"align\":\"center\",\"placeholder\":\"Write title…\",\"fontSize\":\"large\"} -->\n<p class=\"has-text-align-center has-large-font-size\"></p>\n<!-- /wp:paragraph --></div></div>\n<!-- /wp:cover -->\n\n<!-- wp:paragraph -->\n<p>Wasiir Khadiijo Maxamed Diiriye/Facebook</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>\"Maxaa kuu haray? oo da\'dan aad isku qaawin oo maxaad raadineysaa , farriin bey xambaarsan tahay\"</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:social-links -->\n<ul class=\"wp-block-social-links\"><!-- wp:social-link {\"url\":\"dct.so\",\"service\":\"facebook\"} /-->\n\n<!-- wp:social-link {\"url\":\"abdifitah.dct.so\",\"service\":\"twitter\"} /-->\n\n<!-- wp:social-link {\"url\":\"abdifitah.dct.so\",\"service\":\"youtube\"} /--></ul>\n<!-- /wp:social-links -->', '', '', 'inherit', 'closed', 'closed', '', '10-revision-v1', '', '', '2022-09-18 14:03:27', '2022-09-18 11:03:27', '', 10, 'http://localhost/tabaarak/?p=14', 0, 'revision', '', 0),
(15, 1, '2022-09-18 14:18:06', '2022-09-18 11:18:06', '<!-- wp:heading -->\n<h2>Afar arrin oo muhiim ah ka ogow App-ka ay Soomaalidu ku daadatay ee Sweatcoin</h2>\n<!-- /wp:heading -->\n\n<!-- wp:image {\"id\":16,\"sizeSlug\":\"full\",\"linkDestination\":\"none\"} -->\n<figure class=\"wp-block-image size-full\"><img src=\"http://localhost/tabaarak/wp-content/uploads/2022/09/image.png\" alt=\"\" class=\"wp-image-16\"/></figure>\n<!-- /wp:image -->\n\n<!-- wp:paragraph -->\n<p><strong>Waxaa maalimihii dambe si wayn u xoogaystay hadal-haynta ku saabsan App-ka Sweatcoin, kaasoo Soomaali badan ay ka daba dhaceen.</strong></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Baraha bulshada ayaa aad looga dareemayay xiisaynta barnaamijkan oo lacag abaalmarin ah laga helo marka socod la sameeyo.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Dad badan ayaa sida muuqata raadinayay xog ku saabsan app-kan oo aan ahayn mid cusub, balse baraha bulshada ee Soomaalida laga danaynayay.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:heading -->\n<h2 id=\"1-Muxuu-yahay-Sweatcoin\">1. Muxuu yahay Sweatcoin?</h2>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p>Waa barnaamij App ah oo ku shaqeeya teleefoonnada gacanta ee casriga ah ee loo yaqaan \"Smartphones\", waxa aadna si lacag la\'aan ah uga soo degsan kartaa suuqyada dhijitaalka ah ee Android, Windows, iyo iOS.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Sanadkii 2016 ayaa markii ugu horraysay la aasaasay barnaamijkan, saldhiggiisuna waa magaalada London ee dalka Britain.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>App-kan waxa ay ujeeddadiisu tahay inuu xisaabiyo inta tallaabo ee aad qaaddo marka aad socoto ama ordayso. Mar walba tirada socodkaaga ayaad ku helaysaa lacag abaalmarin ah.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:image -->\n<figure class=\"wp-block-image\"><img src=\"https://ichef.bbci.co.uk/news/640/cpsprodpb/0abb/live/9e1b1dd0-14a5-11ed-894d-e96102bbb308.jpg\" alt=\"Socod\"/></figure>\n<!-- /wp:image -->\n\n<!-- wp:paragraph -->\n<p>Jimicsiga uu ka mid yahay socodka ee lagu dhimo miisaanka way adag tahay in la joogteeyo, gaar ahaan marka uusan lahayn wax kugu dhiirrigelinaya, balse haddii aad abaalmarin ku helayso waxaa laga yaabaa in uu kuu sahlanaado.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>\"Ganacsigan gebi ahaantiisba waxaa looga gol leeyahay in qiime loo yeelo dhaqdhaqaaqa,\" ayuu yiri Oleg Fomenko, oo ka mid ah aasaaseyaasha Sweatcoin, mar uu la hadlayay Wakaaladda Wararka ee Reuters.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>\"Ugu dambayn, sweatcoin waxa uu hayaa waddada uu qiime ugu yeelan lahaa lacagta giniga Britain,\" ayuu sii raaciyay hadalkiisa.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:social-links -->\n<ul class=\"wp-block-social-links\"><!-- wp:social-link {\"url\":\"dct.so\",\"service\":\"facebook\"} /-->\n\n<!-- wp:social-link {\"url\":\"dct.so\",\"service\":\"twitter\"} /-->\n\n<!-- wp:social-link {\"url\":\"dct.so\",\"service\":\"youtube\"} /--></ul>\n<!-- /wp:social-links -->\n\n<!-- wp:embed {\"url\":\"https://www.youtube.com/watch?v=R5Xo17R4WaQ\",\"type\":\"video\",\"providerNameSlug\":\"youtube\",\"responsive\":true,\"className\":\"wp-embed-aspect-16-9 wp-has-aspect-ratio\"} -->\n<figure class=\"wp-block-embed is-type-video is-provider-youtube wp-block-embed-youtube wp-embed-aspect-16-9 wp-has-aspect-ratio\"><div class=\"wp-block-embed__wrapper\">\nhttps://www.youtube.com/watch?v=R5Xo17R4WaQ\n</div></figure>\n<!-- /wp:embed -->', 'Technolgy yada iyo caalamka', '', 'publish', 'open', 'open', '', '15-2', '', '', '2022-09-18 14:29:17', '2022-09-18 11:29:17', '', 0, 'http://localhost/tabaarak/?p=15', 0, 'post', '', 0),
