(42, 1, '2022-09-18 14:44:19', '2022-09-18 11:44:19', '<!-- wp:image {\"id\":35,\"width\":836,\"height\":464,\"sizeSlug\":\"full\",\"linkDestination\":\"none\"} -->\n<figure class=\"wp-block-image size-full is-resized\"><img src=\"http://localhost/tabaarak/wp-content/uploads/2022/09/ss2.jpg\" alt=\"\" class=\"wp-image-35\" width=\"836\" height=\"464\"/></figure>\n<!-- /wp:image -->\n\n<!-- wp:paragraph -->\n<p><strong>Saacado kooban ayaa ka dhiman xilliga uu xirmayo suuqa kala iibsiga xiddigaha kubbadda cagta ee shanta horyaal ee ugu weyn Yurub. Waxaa ugu hor xirmi doona suuqyada horyaallada Ingiriiska, La Liga Spain iyo Ligue 1 France.</strong></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Kooxaha waaweyn ee Yurub ayaa suuqa ku farraqay lacag badan si ay u helaan saxiixa xiddigo wax weyn ku soo kordhin kara kooxahooda cusub.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Kooxaha horyaalka Ingiriiska oo keliya oo suuqoodu uu xirmayo saacado kaddib ayaa kharash-gareeyay lacag dhan 1.5 bilyan oo gini saddexdii bil ee uu furnaa suuqa.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Lacagtaas waa qiimaha ugu sarreeya abid ee kooxaha Ingiriiska ay ciyaartoy kula soo wareegaan hal xilli-ciyaareed.</p>\n<!-- /wp:paragraph -->', 'Kulankii ugu adkaay Salah oo Wacdaro dhigay', '', 'publish', 'open', 'open', '', 'kulankii-ugu-adkaay-salah-oo-wacdaro-dhigay', '', '', '2022-09-18 15:11:12', '2022-09-18 12:11:12', '', 0, 'http://localhost/tabaarak/?p=42', 0, 'post', '', 0),
